City of Sin

[RAW - Japanese Audio / UNCENSORED / COMPLETE]



PLOT: The princess Beatrice is to be wed to a barbaric and hideous warrior king, who is more interested in making her his sexual play thing than his queen. She is abruptly taken away from her sheltered home and thrown into the cruel world of her new king and master. He takes away everything that she values and publicly humiliates her until all she has left is to submit to his will. But he isn't finished with her just yet.


